import React from "react";

const AboutMe = () => {
  return (
    <section className="aboutme-section">
      <h2 className="section-title"> About Me </h2>
      <img src="./assets/may.png" alt="black and white photo of May"></img>
      <p>
        I'm a recent graduate from University of Melbourne who majored in
        Computing and Software Systems. I'm interested in full stack web
        development, web design and game development. Throughout my 3 years
        undergraduate degree, I have learnt a variety of different programming
        languages such as Python, C, C#, Java, JavaScript and SQL. Among them,
        Iâ€™m confident in coding with JavaScript and Python and in using HTML and
        CSS. Currently, I have joined the Monash full stack web development
        coding bootcamp to upskill my knowledge in web development and build
        more projects. I also have joined the Monash Professional Year course
        where I am learning a lot about personal and professional development.
        My passion in web design has also driven me to undertake the Google
        UI/UX design course where I am learning about the design process, the
        basis of UX research, prototyping and designing for a mobile app, a
        responsive website, and a cross-platform experience.
      </p>
    </section>
  );
};

export default AboutMe;
